  return (
    <div className="home">
      <div className="home-content">
        <img
          src="https://media.giphy.com/media/9GJ2wj29vRqrrx8LJ7/giphy.gif"
          alt=""
        />
        <Typewriter
          options={{
            strings: ["To Kaise Hai aap log           "],
            autoStart: true,
            loop: true,
          }}
        />
      </div>
    </div>
  );
};

export default Home;
